import { useDispatch, useSelector } from "react-redux";
import EmployeeItem from "./employeeItem";
const EmployeeList = () => {
    const dispatch = useDispatch()
    const empl = useSelector(state => state.employees.employees)
    console.log(empl)
    var employees = [{emplid: "1", first_name: "fedor", last_name: "nikolaev"}, {emplid: "2", first_name: "namepetr", last_name: "andreevich"}, {emplid: "3", first_name: "nikita", last_name: "ivanov"}];
    return ( 
        <tbody>
            {empl.map(
                employee =>
                <EmployeeItem employee = {employee}/>
            )}
        </tbody>
    );
};
export default EmployeeList;
